// OneDark
import React from 'react';
import axios from 'axios'; 
import { useState, useEffect } from "react";
import { useNavigate } from "react-router-dom";
import "./HP.css";
import AppBar from '@mui/material/AppBar';
import Toolbar from '@mui/material/Toolbar';
import Typography from '@mui/material/Typography';
import Button from '@mui/material/Button';
import TextField from '@mui/material/TextField';
import SendIcon from '@mui/icons-material/Send';

const HP = ({setIsLoggedIn, authData}) => {
  const [contactsData, setContactsData] = useState([])

  useEffect(() => {
      axios.get('http://localhost:3002/contacts')
     .then(({data}) => {
      setContactsData(data.contacts)})
 },[])


    let navigate = useNavigate();

    const handleLogOut = () => {
        navigate("../login", { replace: true })
        setIsLoggedIn(false)
    }

    console.log(contactsData)

    return (
      <>
        <AppBar position="static">
          <Toolbar>
             <Typography variant="h6" component="div" sx={{ flexGrow: 1 }}>
                 Contact Manager
              </Typography>
              <Button 
                variant="outlined"
                onClick={handleLogOut}
                color="inherit">
                    Logout
                </Button>
          </Toolbar>
        </AppBar>
      <div className="home__container">
        <div className="name__input">
            <TextField
              id="outlined-name-input"
              style = {{width: 350}}
              label="Name"
              type="name"
            />
        </div>
        <div className="mail__input">
            <TextField
              id="outlined-mail-input"
              style = {{width: 350}}
              label="Mail"
              type="mail"
            />
        </div>
        <div className="phone__input">
            <TextField
              id="outlined-phone-input"
              style = {{width: 350}}
              label="Phone number"
              type="phone"
            />
        </div>
        <div className="login__button">
          <Button variant="contained"  style = {{width: 200}} endIcon={<SendIcon />}>Add contact</Button>
        </div>
      </div>
      </>



    



    );
};

export default HP;
